import React,{useState, useEffect} from 'react';
import { Example } from '../components/example/example.js';

export default Page_example = ()=> {

    const [todo, setTodo] = useState([]);
    useEffect(() => {
        fetch('/api').then(response => {
            if (response.ok) {
                return response.json();
            }
        });
    }, []);
    return (
        <>
            <Example/>
        </>
    );
}
